6796188853147, "width": 0.4846158268475773, "height": 0.06529410368476818}}}, {"type": "paragraph", "text": "Acquisition of e2open", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.27845958748249094, "top": 0.47173204608992036, "width": 0.4430412331012764, "height": 0.06529410368476818}}}], "confidence": 0.95}, {"page_number": 11, "text": "Transaction Highlights\\n\\u25aaWiseTech Global (ASX: WTC) (WiseTech), developer of leading logistics execution software CargoWise, \\nhas acquired US based E2open Parent Holdings, Inc. (NYSE: ETWO) (e2open), a leading provider of SaaS \\nsolutions in the global logistics value chain for US$3.30 per share in cash equating to an enterprise value \\nof US$2.1 billion(1) (the Transaction)\\n\\u25aaThe Transaction evolves WiseTech\\u2019s vision \\u2013 be the operating system for global trade and logistics\\n\\u25aaCreates a strategically significant change in global scale and reach for WiseTech, adding adjacent \\nmarkets and customer bases, and expanding its total addressable market via e2open\\u2019s network of \\n500,000 connected enterprises including connectivity to major ocean carriers, c. 5,600 customers and \\n250+ blue-chip customers\\n\\u25aae2open adds a strong complementary product suite that extends the CargoWise ecosystem, especially \\nin adjacent areas of domestic logistics, carrier integration, global trade and supply chain management, \\nall of which benefits customers and end consumers\\n\\u25aaAccelerates and deepens WiseTech\\u2019s plans to create a multi-sided marketplace connecting asset-based \\ncarriers, logistics providers, importers, exporters, shippers and other logistics and supply chain \\nparticipants\\n\\u25aaAttractive financial metrics with the acquisition expected to be EPS accretive in year one(2) and at least \\nUS$50 million of annualized run rate cost synergies by the end of year two(3)\\n\\u25aaWiseTech funded the acquisition through a new US$3.0 billion syndicated debt facility through a lender \\ngroup comprised of a well-diversified mix of leading domestic and international banks \\nBofA Securities\\u2019 Involvement \\n\\u25aaBofA Securities acted as financial adviser to WiseTech for the Transaction as well as Joint Lead \\nUnderwriter on its US$3.0bn Syndicated Debt Facility\\n\\u25aaThe Transaction represents BofA Securities\\u2019 3rd M&A transaction with WiseTech having previously \\nadvised on WiseTech\\u2019s acquisition of leading landside logistics platform, Envase Technologies for \\nUS$230 million and intermodal solutions provider, Blume Global for US$414 million both in 2023 \\n\\u25aaThe Transaction further demonstrates the strength of BofA Securities\\u2019 execution expertise in \\ntransformational cross-border M&A \\nAbout WiseTech Global\\n\\u25aaWiseTech is a leading developer \\nand provider of software solutions \\nto the logistics execution industry \\nglobally\\n\\u25aaIts customers include over 16,500(4) \\nof the world\\u2019s logistics companies \\nacross 195 countries, including 46 \\nof the top 50 global third-party \\nlogistics providers and 24 of the 25 \\nlargest global freight forwarders \\nworldwide(5)\\nAbout e2Open\\n\\u25aae2open is the connected supply \\nchain software platform that \\nenables the world\\u2019s largest \\ncompanies to transform the way \\nthey make, move, and sell goods \\nand services\\n\\u25aaWith the broadest cloud-native \\nglobal platform purpose-built for \\nmodern supply chains, e2open \\nconnects more than 500,000 \\nmanufacturing, logistics, channel, \\nand distribution partners as one \\nmulti-enterprise network tracking \\nover 18 billion transactions annually\\nWiseTech Global has acquired e2open for US$2.1 billion\\n\\u201cBank of America\\u201d and \\u201cBofA Securities\\u201d are the marketing names used by the Global Banking and Global Markets divisions of Bank of America Corporation. Lending, other commercial banking activities, and trading in certain financial instruments are performed globally by banking affiliates of Bank of America Corporation, \\nincluding Bank of America, N.A., Member FDIC. Trading in securities and financial instruments, and strategic advisory, and other investment banking activities, are performed globally by investment banking affiliates of Bank of America Corporation (\\u201cInvestment Banking Affiliates\\u201d), including, in the United States, BofA Securities, \\nInc. and Merrill Lynch Professional Clearing Corp., both of which are registered broker-dealers and Members of SIPC, and, in other jurisdictions, by locally registered entities. BofA Securities, Inc. and Merrill Lynch Professional Clearing Corp. are registered as futures commission merchants with the CFTC and are members of the \\nNFA. Investment products offered by Investment Banking Affiliates:Are Not FDIC Insured \\u2022 May Lose Value \\u2022 Are Not Bank Guaranteed.The material contained herein is for our corporate clients and is not a solicitation of a proxy from any security holder in respect of any transaction or an offer or solicitation to sell or purchase \\nany securities. Nothing contained herein is or shall constitute any encouragement, solicitation, advice or recommendation as to how any party should act in relation to the matters described herein or any other transaction or situation.\\nhas agreed to acquire\\nfor\\nFinancial Adviser to \\nWiseTech Global\\n7\\n____________________\\nSource: Publicly available information and press releases.\\n(1)\\nEnterprise value of $2.1b comprises $1.2b of cash consideration to e2open shareholders, gross debt (exclusive of debt-like items) of $1.1b and $0.2b in cash.\\n(2)\\nFY25PF EPS accretion as if the acquisition was effective from 1 July 2024. Excludes one-off transaction costs, integration costs and cost synergies. \\n(3)\\nProgram costs to execute mainly expected in first 12 months from acquisition offsetting actual year 1 savings.\\n(4)\\nIncludes customers on CargoWise and platforms of acquired businesses whose customers may be counted with reference to installed sites\\n(5)\\nArmstrong & Associates: Top 50 Global 3PLs & Top 25 Global Freight Forwarders ranked by 2023 gross logistics revenue/turnover and freight forwarding volumes \\u2013 updated 14 August 2024. \\nUS$2.1 billion\\n", "blocks": [{"type": "paragraph", "text": "Transaction Highlights", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.22248738221447878, "top": 0.1652123943652982, "width": 0.11581014382718789, "height": 0.016274508307961857}}}, {"type": "paragraph", "text": "\\u25aaWiseTech Global (ASX: WTC) (WiseTech), developer of leading logistics execution software CargoWise, ", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.22248738221447878, "top": 0.19066335640701593, "width": 0.5374884749903823, "height": 0.01869942160213695}}}, {"type": "paragraph", "text": "has acquired US based E2open Parent Holdings, Inc. (NYSE: ETWO) (e2open), a leading provider of SaaS solutions in the global logistics value chain for US$3.30 per share in cash equating to an enterprise value of US$2.1 billion(1) (the Transaction)", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.23354798133927163, "top": 0.212696100372115, "width": 0.5349976896035551, "height": 0.055490207048802594}}}, {"type": "paragraph", "text": "\\u25aaThe Transaction evolves WiseTech\\u2019s vision \\u2013 be the operating system for global trade and logistics", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.22248738221447878, "top": 0.275565303229039, "width": 0.5106260704271721, "height": 0.01869942160213695}}}, {"type": "paragraph", "text": "\\u25aaCreates a strategically significant change in global scale and reach for WiseTech, adding adjacent ", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.22248738221447878, "top": 0.3016437206392974, "width": 0.5067592004332879, "height": 0.01869942160213695}}}, {"type": "paragraph", "text": "markets and customer bases, and