.\\n(3)\\nRepresents $50mm in annualized run rate cost synergies, expected to be realized by end of year two. \\n\\u201cThe acquisition of e2open is a strategically significant opportunity for WiseTech \\nto acquire a scaled and profitable leading provider in adjacent and \\ncomplementary markets. It brings WiseTech\\u2019s customers, and their customers and \\nsuppliers, into an electronically connected multi-sided marketplace and will extend \\nthe value that we create for customers in logistics, Container Transport \\nOptimization, global trade and supply chain management. It also expands \\nWiseTech\\u2019s customer base adding a network of 500,000 connected enterprises \\nincluding major connectivity with ocean carriers and numerous blue-chip shippers\\u201d\\n- Richard White, Co-Founder of WiseTech\\n", "blocks": [{"type": "paragraph", "text": "\\u25fcOn May 25th, WiseTech announced the acquisition of e2open, for $3.30 per share in cash, representing a total enterprise value of ~$2.1bn(1)", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.05696969562106662, "top": 0.2787745357338899, "width": 0.37435095719616823, "height": 0.06769606646369486}}}, {"type": "paragraph", "text": "\\u25fcRepresents EV / FY25A Adj. EBITDA(2) multiple of 9.7x", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.08881818405305496, "top": 0.36900324603311374, "width": 0.3494115790935478, "height": 0.020637262880412583}}}, {"type": "paragraph", "text": "\\u25fcRepresents EV / FY26E Adj. EBITDA (2) multiple of 10.1x", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.08881818405305496, "top": 0.41214054082733353, "width": 0.3578964291196881, "height": 0.02063721301508885}}}, {"type": "paragraph", "text": "\\u25fcThe per-share purchase price represents a premium of approximately 68% over the company\\u2019s closing stock price on April 30, 2025, the day prior to media reports regarding WiseTech\\u2019s evaluation of a potential acquisition of e2open ", "conf