xt": "____________________Source: Company filings.Note: e2open FYE 2/28.(1)Enterprise value of $2.1bn comprises $1.2bn of cash consideration to Emerald shareholders, and gross debt (exclusive of debt-like items) of $1.1bn and $0.2bn in cash.(2)EBITDA is banking covenant definition which is adjusted from reported EBITDA.(3)Represents $50mm in annualized run rate cost synergies, expected to be realized by end of year two. ", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.0604545468031758, "top": 0.9122549817453023, "width": 0.6188984928709088, "height": 0.07999993617238563}}}, {"type": "paragraph", "text": "\\u201cThe acquisition of e2open is a strategically significant opportunity for WiseTech to acquire a scaled and profitable leading provider in adjacent and complementary markets. It brings WiseTech\\u2019s customers, and their customers and suppliers, into an electronically connected multi-sided marketplace and will extend the value that we create for customers in logistics, Container Transport Optimization, global trade and supply chain management. It also expands WiseTech\\u2019s customer base adding a network of 500,000 connected enterprises including major connectivity with ocean carriers and numerous blue-chip shippers\\u201d", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.4963636301984691, "top": 0.6828267714556526, "width": 0.46588365959398675, "height": 0.16905556473077513}}}, {"type": "paragraph", "text": "- Richard White, Co-Founder of WiseTech", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.6600252401949179, "top": 0.8769803514667586, "width": 0.23522332702020202, "height": 0.018039279513888888}}}], "confidence": 0.95}, {"page_number": 13, "text": "9\\nStrategic Rationale of Transaction\\n____________________\\nSource: Company filings.\\nThe acquisition of e2open propels WiseTech\\u2019s vision to becoming the universal operating system for global trade and logistics\\nProduct\\nExtend and Accelerate WiseTech\\u2019s Technological & Product Development Roadmap\\nExpands WiseTech's TAM via the addition of complementary product offerings, capturing 20 years of R&D and M&A with a single transaction\\nEnhances visibility across the shipping process that complement WiseTech's solutions to drive further customer benefits including freight \\nefficiencies (particularly with manufacturers, warehousers and retailers)\\nAccelerates delivery and take up of new and innovative solutions in global trade management (GTM) and container transport optimization (CTO)\\nPenetration\\nExpand Market Penetration and Total Addressable Market\\nBroadens WiseTech's ecosystem with a network of ~500,000 connected enterprises including the establishment of a major foothold \\nincluding connectivity to major ocean carriers, ~5,600 customers and 250+ bluechip customers\\nAddress inefficiencies within a $11+ trillion market involving local and regional in addition to global partners\\nExpansive network built over 20+ years with connectivity across all major commerce ecosystems globally\\nProfitability\\nAttractive Valuation with Ability to Realize Strategic Synergies and Cross-Selling Capabilities\\nPro-forma WiseTech has achievable cost-optimization and future growth opportunities, with ~$50mm annualized cost synergies by year 2, with \\nthe acquisition projected to be EPS accretive in year one \\n", "blocks": [{"type": "paragraph", "text": "9", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.03545454535821472, "top": 0.9444608002706291, "width": 0.0063759076474892975, "height": 0.01627444597630719}}}, {"type": "paragraph", "text": "Strategic Rationale of Transaction", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.03545454535821472, "top": 0.05609805287878498, "width": 0.47222983475887415, "height": 0.04572548585779527}}}, {"type": "paragraph", "text": "____________________Source: Company filings.", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.045454545454545456, "top": 0.9476274477890114, "width": 0.08786074320475261, "height": 0.02509801528033088}}}, {"type": "paragraph", "text": "The acquisition of e2open propels WiseTech\\u2019s vision to becoming the universal operating system for global trade and logistics", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.14523989744860716, "top": 0.1386601566489226, "width": 0.720053509028271, "height": 0.01803921718223422}}}, {"type": "paragraph", "text": "ProductExtend and Accelerate WiseTech\\u2019s Technological & Product Development Roadmap", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2534217256488222, "top": 0.18158497529871323, "width": 0.5037653951933889, "height": 0.045441172481362334}}}, {"type": "paragraph", "text": "Expands WiseTech's TAM via the addition of complementary product offerings, capturing 20 years of R&D and M&A with a single transaction", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.1273358566592438, "top": 0.2603921827927134, "width": 0.8023111844303632, "height": 0.018039204715903288}}}, {"type": "paragraph", "text": "Enhances visibility across the shipping process that complement WiseTech's solutions to drive further customer benefits including freight efficiencies (particularly with manufacturers, warehousers and retailers)", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.12445454645638514, "top": 0.3277287701376123, "width": 0.7797607942060991, "height": 0.03960780224768944}}}, {"type": "paragraph", "text": "Accelerates delivery and take up of new and innovative solutions in global trade management (GTM) and container transport optimization (CTO)", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.1273358566592438, "top": 0.4166340048796211, "width": 0.815033161278927, "height": 0.018039229648565157}}}, {"type": "paragraph", "text": "PenetrationExpand Market Penetration and Total Addressable Market", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.3281565579501065, "top": 0.4743300793217678, "width": 0.35417664653123027, "height": 0.045450995950137865}}}, {"type": "paragraph", "text": "Broadens WiseTech's ecosystem with a network of ~500,000 connected enterprises including the establishment of a major foothold including connectivity to major ocean carriers, ~5,600 customers and 250+ bluechip customers", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.1273358566592438, "top": 0.542352963117213, "width": 0.7449243429935339, "height": 0.03960782718035131}}}, {"type": "paragraph", "text": "Address inefficiencies within a $11+ trillion market involving local and regional in addition to global partners", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.1273358566592438, "top": 0.6312581479938981, "width": 0.6102559735076596, "height": 0.018039229648565157}}}, {"type": "paragraph", "text": "Expansive network built over 20+ years with connectivity across all major commerce ecosystems globally", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.1273358566592438, "top": 0.7093790590373519, "width": 0.5899778134895094, "height": 0.018039229648565157}}}, {"type": "paragraph", "text": "ProfitabilityAttractive Valuation with Ability to Realize Strategic Synergies and Cross-Selling Capabilities", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.22599748168328795, "top": 0.7671078451318678, "width": 0.5584878439855094, "height": 0.045441172481362334}}}, {"type": "paragraph", "text": "Pro-forma WiseTech has achievable cost-optimization and future growth opportunities, with ~$50mm annualized cost synergies by year 2, with the acquisition projected to be EPS accretive in year one ", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.1273358566592438, "top": 0.8350980172749438, "width": 0.8133606284555762, "height": 0.03960787704567504}}}], "confidence": 0.95}, {"page_number": 14, "text": "$3.30\\n(68.8%)\\nF\\nI\\nJ\\nG\\nB\\nH\\nD\\nC\\nE\\nA\\nK\\nL\\n10\\ne2open Stock Price Performance (Since De-SPAC)\