xt": "Auto", "confidence": 0.92, "geometry": {"x": 952, "y": 2110, "width": 57, "height": 20}}, {"text": "Q", "confidence": 0.92, "geometry": {"x": 1066, "y": 2107, "width": 26, "height": 26}}, {"text": "Web", "confidence": 0.96, "geometry": {"x": 1109, "y": 2110, "width": 54, "height": 20}}, {"text": "@", "confidence": 0.92, "geometry": {"x": 1220, "y": 2106, "width": 27, "height": 28}}, {"text": "Attach", "confidence": 0.96, "geometry": {"x": 1267, "y": 2110, "width": 81, "height": 20}}, {"text": "\\u00a9", "confidence": 0.96, "geometry": {"x": 2316, "y": 2104, "width": 24, "height": 32}}], "metadata": {"width": 3456, "height": 2234, "format": "PNG", "mode": "RGBA", "size_bytes": 1276771, "original_format": "PNG"}}}	vision_ocr
4_30 - Mtg with Christina.pdf	attachments/2025/09/118fca54-aa00-4b5d-92fd-e54bd518c0ee.pdf	application/pdf	63293	52aa5c70784d97b435905a2a0add8ef0c2bdaf2848f8f30039690bac874393c4	DOCUMENT	PROCESSED	4b9d794c-50ca-41bf-bfe6-d8c47a4995be	2025-09-29 17:31:42.630657+00	2025-09-29 17:31:52.05086+00	\N	1	\N	\N	During a meeting with Christina, she mentioned multiple issues and concerns about the Shipment Uploader of Shipwell which include confusion caused by multiple logins, difficulty in managing a system that has a brokerage arm, data integrity not meeting standard, and issues pertaining to Detention data and EDI. She also talked about the need to upgrade basic functionalities in Shipwell. Christina feels positive about Shipwell being easy to navigate, user-friendly, and refreshingly honest in the...	\N	\N	en	\N	\N	\N	f	\N	0	\N	\N	\N	\N	\N	\N	9	\N	118fca54-aa00-4b5d-92fd-e54bd518c0ee	\N	\N	2025-09-29 17:31:42.58584+00	2025-09-29 17:31:52.051385+00	\N	408d18a7-e16b-4102-b51b-ddde79c95acc	{"document": {"pages": [{"page_number": 1, "text": "4/30 - Mtg with Christina\\n\\u25cf\\nDSR Upload file (Shipwell\\u2019s Shipment Uploader)\\n\\u25cb\\nTalked with Crystal after meeting with Kelly on Wednesday\\n\\u25cb\\nNot going to use the Custom Data field\\n\\u25cb\\nPlan is to roll it out Week 20 (not next week, the week after)\\n\\u25a0\\nNext week, give demos, talk to DC ops - on Tuesday\\n\\u25cf\\nThey honestly should just use Christina\\u2019s login for demo, no need\\nto create a bunch of logins, it\\u2019ll get confusing for their team\\n\\u25cb\\nThis will be a painpoint for them in going live with the Shipment Uploader, but\\ndoesn\\u2019t seem to be a blocker (today...on Wednesday it was a blocker for her)\\n\\u25a0\\nhttps://shipwell.atlassian.net/browse/FEED-2622\\n\\u25cf\\nChristina thinks they\\u2019re going to go with BluJay\\n\\u25cb\\nFor her personally, she doesn\\u2019t like having to manage a system who also has a\\nbrokerage arm\\n\\u25a0\\nNot that her 3PLs would refuse to work with her because Shipwell has a\\nbrokerage, but she doesn\\u2019t like having to have that \\u201cworry\\u201d looming over\\nher brokers\\n\\u25cb\\nThey\\u2019re not using BluJay\\u2019s 4PL arm, they\\u2019re bringing on HF-specific logistics\\ncoordinators to work after-hours\\n\\u25cb\\nWhat she likes about BluJay & doesn\\u2019t like about Shipwell...\\n\\u25a0\\nWhen customers/carriers make changes in the platform, those updates go\\nout in a clear way via BluJay - Shipwell doesn\\u2019t have this\\n\\u25cf\\nTicket from Dec 2020 -\\nhttps://shipwell.atlassian.net/browse/FEED-2630\\n\\u25a0\\nDetention data - it\\u2019s difficult because her whole team has the ability to\\ncreate address book items\\n\\u25cf\\nKENZI\\u2019S OPINION - we should delete the \\u201csave to address book\\u201d\\nbutton, it\\u2019s confusing and creates duplicates. Hard for them to stay\\norganized and therefore our data to make sense\\n\\u25cb\\nShe confirmed this too\\n\\u25a0\\nShe feels there are a lot of actions that cancel out each other, rather than\\nworking with each other - a lot of workarounds required\\n\\u25a0\\nThe data integrity is not at the standard that they need it to be, to be able\\nto move the needle with conversations\\n\\u25cf\\nDidn\\u2019t get much info/feedback on what she meant by this\\n\\u25a0\\nReiterated the need to figure out how the system deals with changes\\n(load changes, pickup changes via email notifications)\\n\\u25a0\\nShipwell needs a lot of upgrades to basic functionality\\n\\u25cf\\nExample she gave: Routing Guide\\n\\u25a0\\nHow do we make a system that is clean and functions and talks within\\nitself - to know the data integrity is valid\\n", "blocks": [{"type": "paragraph", "text": "4/30 - Mtg with Christina", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.36852628421160133, "top": 0.09148738360164141, "width": 0.2629510218801062, "height": 0.019748263888888888}}}, {"type": "paragraph", "text": "\\u25cfDSR Upload file (Shipwell\\u2019s Shipment Uploader)", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.14705882352941177, "top": 0.15147199534406566, "width": 0.41243065728081596, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cbTalked with Crystal after meeting with Kelly on Wednesday\\u25cbNot going to use the Custom Data field\\u25cbPlan is to roll it out Week 20 (not next week, the week after)", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.16983849111229482, "width": 0.5022887186287275, "height": 0.05224948459201389}}}, {"type": "paragraph", "text": "\\u25a0Next week, give demos, talk to DC ops - on Tuesday", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.22493797841698232, "width": 0.4467059366064134, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cfThey honestly should just use Christina\\u2019s login for demo, no needto create a bunch of logins, it\\u2019ll get confusing for their team\\u25cbThis will be a painpoint for them in going live with the Shipment Uploader, butdoesn\\u2019t seem to be a blocker (today...on Wednesday it was a blocker for her)", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.24330447418521148, "width": 0.6659088134765625, "height": 0.07061598036024305}}}, {"type": "paragraph", "text": "\\u25a0https://shipwell.atlassian.net/browse/FEED-2622", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.31677045725812814, "width": 0.41477278167126225, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cfChristina thinks they\\u2019re going to go with BluJay", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.14705882352941177, "top": 0.3535034487945865, "width": 0.4008040583990758, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cbFor her personally, she doesn\\u2019t like having to manage a system who also has abrokerage arm", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.37186994456281564, "width": 0.6560627058440563, "height": 0.033882988823784724}}}, {"type": "paragraph", "text": "\\u25a0Not that her 3PLs would refuse to work with her because Shipwell has abrokerage, but she doesn\\u2019t like having to have that \\u201cworry\\u201d looming overher brokers\\u25cbThey\\u2019re not using BluJay\\u2019s 4PL arm, they\\u2019re bringing on HF-specific logisticscoordinators to work after-hours\\u25cbWhat she likes about BluJay & doesn\\u2019t like about Shipwell...", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.408602936099274, "width": 0.6593114316853044, "height": 0.1073489718967014}}}, {"type": "paragraph", "text": "\\u25a0When customers/carriers make changes in the platform, those updates goout in a clear way via BluJay - Shipwell doesn\\u2019t have this", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.518801910708649, "width": 0.6174315408943525, "height": 0.033882988823784724}}}, {"type": "paragraph", "text": "\\u25cfTicket from Dec 2020 -https://shipwell.atlassian.net/browse/FEED-2630\\u25a0Detention data - it\\u2019s difficult because her whole team has the ability tocreate address book items", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.5555349022451074, "width": 0.5798776663985907, "height": 0.07061598036024305}}}, {"type": "paragraph", "text": "\\u25cfKENZI\\u2019S OPINION - we should delete the \\u201csave to address book\\u201dbutton, it\\u2019s confusing and creates duplicates. Hard for them to stayorganized and therefore our data to make sense", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.3235294117647059, "top": 0.629000885318024, "width": 0.5552357193691279, "height": 0.05224948459201389}}}, {"type": "paragraph", "text": "\\u25cbShe confirmed this too\\u25a0She feels there are a lot of actions that cancel out each other, rather thanworking with each other - a lot of workarounds required\\u25a0The data integrity is not at the standard that they need it to be, to be ableto move the needle with conversations", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.6841003726227115, "width": 0.6095289841196896, "height": 0.08898247612847222}}}, {"type": "paragraph", "text": "\\u25cfDidn\\u2019t get much info/feedback on what she meant by this\\u25a0Reiterated the need to figure out how the system deals with changes(load changes, pickup changes via email notifications)\\u25a0Shipwell needs a lot of upgrades to basic functionality", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.7759328514638574, "width": 0.5745654137305964, "height": 0.07061598036024305}}}, {"type": "paragraph", "text": "\\u25cfExample she gave: Routing Guide\\u25a0How do we make a system that is clean and functions and talks withinitself - to know the data integrity is valid", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.849398834536774, "width": 0.5844911064197814, "height": 0.05224948459201389}}}], "confidence": 0.95}, {"page_number": 2, "text": "\\u25a0\\nStreamlining load statuses - it\\u2019s confusing because Shipwell\\u2019s statuses\\nare not what the logistics industry uses...\\n\\u25cf\\nShipwell uses \\u201cQuoting\\u201d when a shipment is actually Tendered and\\nwaiting acceptance.\\n\\u25cf\\nWhile \\u201cTendered\\u201d to Shipwell means load is accepted\\n\\u25cf\\nTender Reject status needed\\n\\u25cf\\nhttps://shipwell.atlassian.net/browse/FEED-2645\\n\\u25a0\\nFiltering through Reports\\n\\u25cf\\nShe said it\\u2019s touchy\\n\\u25cf\\nThey\\u2019ll want to look at a certain origin or zip code\\n\\u25cf\\nThey\\u2019ll have to try 3-4x on a filter in order to get the report to run\\n\\u25a0\\nEDI - \\u201cit shouldn\\u2019t be taking 3 months for a carrier to get on EDI\\u201d - biggest\\nred flag to Christina\\n\\u25cf\\nIf carrier is going to invest/pay money out of pocket for\\nintegrations, it should happen quickly\\n\\u25cf\\nShe knows we\\u2019re honing in on API - but that\\u2019s an entirely new\\nconcept. Carriers don\\u2019t know what API means, carriers don\\u2019t have\\nthe resources for an API integration - they know and do EDI\\n\\u25cb\\nShe\\u2019s hearing more about API for predictive modeling,\\nrating, etc.\\n\\u25cb\\nNot API for carrier connections - status updates, tending,\\netc.\\n\\u25cb\\nPlus side about Shipwell\\u2026\\n\\u25a0\\nEasy to navigate\\n\\u25a0\\nNot overwhelming\\n\\u25a0\\nVery user-friendly\\n\\u25a0\\nNot too many bells and whistles\\n\\u25a0\\nCan easily digest and come in\\n\\u25a0\\nWhen they\\u2019ve asked us for something, we\\u2019re honest if we can/can\\u2019t do it -\\nthat has been refreshing for her\\n\\u25cf\\nIf we could/would do it, we were \\u201con it\\u201d\\n\\u25cf\\nHard to find straight-shooters, \\u201ckudos to you for that\\u201d\\n\\u25cf\\nDSR Upload file, Summary Email, BOL - we were on it and\\nreleased those items quickly\\n\\u25cf\\nDigital Documents\\n\\u25cb\\nShe\\u2019s super impressed, said it\\u2019s the \\u201cnicest BOL\\nfunctionality I\\u2019ve ever seen\\u201d\\n\\u25a0\\nThis was the first time she felt we truly understood\\ntransportation\\n\\u25a0\\n\\u201cShe thinks this was the first time Shipwell started\\nthinking like a transportation company and not a\\ntech company\\u201d\\n", "blocks": [{"type": "paragraph", "text": "\\u25a0Streamlining load statuses - it\\u2019s confusing because Shipwell\\u2019s statusesare not what the logistics industry uses...", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.09136346373895202, "width": 0.5888426537607231, "height": 0.033882988823784724}}}, {"type": "paragraph", "text": "\\u25cfShipwell uses \\u201cQuoting\\u201d when a shipment is actually Tendered andwaiting acceptance.\\u25cfWhile \\u201cTendered\\u201d to Shipwell means load is accepted\\u25cfTender Reject status needed\\u25cfhttps://shipwell.atlassian.net/browse/FEED-2645\\u25a0Filtering through Reports", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.12809645527541036, "width": 0.617388955907884, "height": 0.1073489718967014}}}, {"type": "paragraph", "text": "\\u25cfShe said it\\u2019s touchy\\u25cfThey\\u2019ll want to look at a certain origin or zip code\\u25cfThey\\u2019ll have to try 3-4x on a filter in order to get the report to run\\u25a0EDI - \\u201cit shouldn\\u2019t be taking 3 months for a carrier to get on EDI\\u201d - biggestred flag to Christina", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.23829542988478536, "width": 0.610426260754953, "height": 0.08898247612847222}}}, {"type": "paragraph", "text": "\\u25cfIf carrier is going to invest/pay money out of pocket forintegrations, it should happen quickly\\u25cfShe knows we\\u2019re honing in on API - but that\\u2019s an entirely newconcept. Carriers don\\u2019t know what API means, carriers don\\u2019t havethe resources for an API integration - they know and do EDI", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.3235294117647059, "top": 0.3301279087259312, "width": 0.5505246430440666, "height": 0.08898247612847222}}}, {"type": "paragraph", "text": "\\u25cbShe\\u2019s hearing more about API for predictive modeling,rating, etc.\\u25cbNot API for carrier connections - status updates, tending,etc.\\u25cbPlus side about Shipwell\\u2026", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.42196038756707704, "width": 0.6571438857932496, "height": 0.08898247612847222}}}, {"type": "paragraph", "text": "\\u25a0Easy to navigate\\u25a0Not overwhelming\\u25a0Very user-friendly\\u25a0Not too many bells and whistles\\u25a0Can easily digest and come in\\u25a0When they\\u2019ve asked us for something, we\\u2019re honest if we can/can\\u2019t do it -that has been refreshing for her", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.5137928664082229, "width": 0.6094503963694853, "height": 0.12571546766493055}}}, {"type": "paragraph", "text": "\\u25cfIf we could/would do it, we were \\u201con it\\u201d\\u25cfHard to find straight-shooters, \\u201ckudos to you for that\\u201d\\u25cfDSR Upload file, Summary Email, BOL - we were on it andreleased those items quickly\\u25cfDigital Documents", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.3235294117647059, "top": 0.642358336785827, "width": 0.4965799369064032, "height": 0.08898247612847222}}}, {"type": "paragraph", "text": "\\u25cbShe\\u2019s super impressed, said it\\u2019s the \\u201cnicest BOLfunctionality I\\u2019ve ever seen\\u201d", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.38235294117647056, "top": 0.7341908156269729, "width": 0.4101065841375613, "height": 0.033882988823784724}}}, {"type": "paragraph", "text": "\\u25a0This was the first time she felt we truly understoodtransportation\\u25a0\\u201cShe thinks this was the first time Shipwell startedthinking like a transportation company and not atech company\\u201d", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.4411764705882353, "top": 0.7709238071634312, "width": 0.42771752052057804, "height": 0.08898247612847222}}}], "confidence": 0.95}, {"page_number": 3, "text": "\\u25cf\\nI asked about the transition plan with the new TMS - She thinks they\\u2019ll stick with Shipwell\\nuntil they have a better grasp with how it\\u2019ll roll out,\\n\\u25cb\\nShe knows they will need the data from Shipwell to transfer over to new system\\nDIDN\\u2019T GET TO THIS - go over next week...\\n\\u25cf\\nContinue having Friday touch-base calls? 30min work? Or want to do 1 hr again?\\n\\u25cb\\nInclude Cindy on these invites\\n\\u25cf\\nGo over release notes\\n\\u25cb\\nA few bugs were fixed specific to HF - tag behavior\\n\\u25cb\\nDigital Documents\\n\\u25a0\\nCindy to demo if needed\\n\\u25a0\\nWill be available on MONDAY (confirm with Cindy)\\n\\u25cb\\nManual triggers on New Shipment will not trigger automated routing guide\\n\\u25a0\\nVery good news - specific to HelloFresh\\n\\u25cf\\nEDI\\n\\u25cb\\nEcho - still going back and forth\\n", "blocks": [{"type": "paragraph", "text": "\\u25cfI asked about the transition plan with the new TMS - She thinks they\\u2019ll stick with Shipwelluntil they have a better grasp with how it\\u2019ll roll out,", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.14705882352941177, "top": 0.09136346373895202, "width": 0.7319024777879902, "height": 0.033882988823784724}}}, {"type": "paragraph", "text": "\\u25cbShe knows they will need the data from Shipwell to transfer over to new system", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.12809645527541036, "width": 0.6593585045509089, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "DIDN\\u2019T GET TO THIS - go over next week...", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.11764705882352941, "top": 0.16482944681186867, "width": 0.35169364580141954, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cfContinue having Friday touch-base calls? 30min work? Or want to do 1 hr again?", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.14705882352941177, "top": 0.18319594258009786, "width": 0.6733757467830882, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cbInclude Cindy on these invites", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.20156243834832702, "width": 0.26804277008655025, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cfGo over release notes", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.14705882352941177, "top": 0.23829542988478536, "width": 0.20613492080588747, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cbA few bugs were fixed specific to HF - tag behavior\\u25cbDigital Documents", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.25666192565301454, "width": 0.4327329747817096, "height": 0.033882988823784724}}}, {"type": "paragraph", "text": "\\u25a0Cindy to demo if needed\\u25a0Will be available on MONDAY (confirm with Cindy)\\u25cbManual triggers on New Shipment will not trigger automated routing guide", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.29339491718947286, "width": 0.6144671969943576, "height": 0.05224948459201389}}}, {"type": "paragraph", "text": "\\u25a0Very good news - specific to HelloFresh", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.2647058823529412, "top": 0.34849440449416036, "width": 0.3448747123768127, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cfEDI", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.14705882352941177, "top": 0.3852273960306187, "width": 0.059359332315282884, "height": 0.015516493055555556}}}, {"type": "paragraph", "text": "\\u25cbEcho - still going back and forth", "confidence": 0.95, "geometry": {"bounding_box": {"left": 0.20588235294117646, "top": 0.40359389179884786, "width": 0.2800119437423407, "height": 0.015516493055555556}}}], "confidence": 0.95}], "metadata": {"total_pages": 3, "language": "auto-detected", "document_type": "pdf"}}}	document_parser
